import React from 'react'
import PropTypes from 'prop-types';
import './button.css'

const Button = (props) => {
    const { text } = props;

    return (
        <button className='btn'>{text}</button>
    )
}

Button.propTypes = {
    text: PropTypes.string.isRequired,
}

export default Button;
